IDO 智能手环iOS SDK
1.1功能概述
IDOBluetooth、IDOBlueProtocol、IDOBlueUpdate适用于iOS设备并支持IDO公司的手环，实现蓝牙连接控制框架库。基于iOS系统的蓝牙框架，扩展了蓝牙扫描、连接、绑定、控制、设置、获取、监听、传输等功能。利用c编写的协议库实现结构体数据的转换和健康数据同步过程中逻辑处理，减少了蓝牙通信数据的错误，提高了蓝牙通信的速度和准确性。这个特性丰富的API易于使用。
1.2快速集成
1.2.1 使用 Cocoapods 集成
在Podfile文件中添加以下内容：
source 'https://github.com/idoosmart/IDOSmartSpec.git'
platform :ios, '8.0'
target 'your_target_name' do
   pod 'IDOBluetooth'
   pod 'IDOBlueProtocol'
   pod 'IDOBlueUpdate'
end

然后在项目根目录下执行 pod update 命令，集成第三方库。
CocoaPods的使用请参考：CocoaPods Guides
1.3初始化 SDK

打开项目设置，Target => Build Settings，修改 Other Linker Flags 添加 -Objc
Objective-C工程需要添加一个空的Swift文件,生成Objective-C Bridging Header
依赖系统库CoreBluetooth.framework``libc++.tbd``libsqlite3.0.tbd
在项目的PrefixHeader.pch文件添加以下内容：

#import 
#import 
#import 

Swift 项目添加以下内容
import IDOBlueUpdate
import IDOBluetooth
import IDOBlueProtocol

1.3.1 注册SDK

打开AppDelegate.m文件，在[AppDelegate application:didFinishLaunchingWithOptions:]方法中注册SDK：
