自动扫描连接超时时长
默认20


rssiNum
设置扫描过滤信号
默认值80


isIntervalScan
是否启动超时间隔扫描
默认yes


isReconnect
是否需要重连机制
默认yes


autoScanInterval
设置扫描间隔时长
默认10秒


scanMode
蓝牙扫描设备模式
readonly


state
蓝牙管理连接状态
readonly


errorCode
蓝牙连接错误码
readonly


manualConnectTotalTime
手动点击连接设备的总时长
readonly


autoConnectTotalTime
自动扫描到成功连接设备的总时长
readonly




2.5基础方法
Objc:
//开始扫描
[IDOBluetoothManager startScan];
//刷新蓝牙代理
[IDOBluetoothManager refreshDelegate];
//停止扫描
[IDOBluetoothManager stopScan];
//连接设备
[IDOBluetoothManager connectDeviceWithModel:model];
//断开当前外围设备的连接
[IDOBluetoothManager cancelCurrentPeripheralConnection];

Swift:
 //开始扫描
 IDOBluetoothManager.startScan();
 //刷新蓝牙代理
 IDOBluetoothManager.refreshDelegate();
 //停止扫描
 IDOBluetoothManager.stopScan();
 //连接设备
 IDOBluetoothManager .connectDevice(with: model as? IDOPeripheralModel); 
 //断开当前外围设备的连接
 IDOBluetoothManager.cancelCurrentPeripheralConnection();

