//此方法需要在连接状态时，执行成功回调，属于双方解绑，并删除手环数据
[IDOFoundationCommand unbindingCommand:^(int errorCode) {
    if (errorCode == 0) {
       //解绑成功
    }else {
       //解绑失败
    }
 }];

