此方法在连接状态时，执行成功回调，属于双方解绑，并删除手环数据；
在断开状态时，执行成功回调，App单方解绑，并不会删除手环数据；
*/
  IDOFoundationCommand.mandatoryUnbindingCommand { (errorCode) in
    if errorCode == 0 {
       //解绑成功
    }else {  
       //解绑失败     
